external-controller: 127.0.0.1:10000
ipv6: true
mode: rule
mixed-port: 10220
socks-port: 10221
port: 10222
redir-port: 0
tproxy-port: 0
allow-lan: false
unified-delay: false
tcp-concurrent: false
log-level: info
find-process-mode: strict
bind-address: "*"
lan-allowed-ips:
  - 0.0.0.0/0
  - ::/0
lan-disallowed-ips: []
authentication: []
skip-auth-prefixes:
  - 127.0.0.1/32
tun:
  enable: false
  device: Mihomo
  stack: mixed
  auto-route: true
  auto-redirect: false
  auto-detect-interface: true
  dns-hijack:
    - any:53
  mtu: 1500
  strict-route: true
dns:
  enable: true
  ipv6: true
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  fake-ip-filter:
    - "*"
    - +.lan
    - +.local
    - time.*.com
    - ntp.*.com
    - +.market.xiaomi.com
  use-hosts: false
  use-system-hosts: false
  nameserver:
    - https://1.0.0.1/dns-query
    - https://cloudflare-dns.com/dns query
    - https://1.1.1.1/dns-query
  proxy-server-nameserver:
    - https://1.1.1.1/dns-query
    - https://cloudflare-dns.com/dns query
    - https://1.0.0.1/dns-query
  respect-rules: true
  fallback: []
  fallback-filter: {}
sniffer:
  enable: true
  parse-pure-ip: true
  force-dns-mapping: true
  override-destination: false
  sniff:
    HTTP:
      ports:
        - 80
        - 443
      override-destination: false
